  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Prime
  Hook National Wildlife Refuge outlines Refuge accomplishments during the 1972 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, predators, mammals, raptors,
  fish, reptiles, and diseases- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, vegetation control, and wildfires.
  Resource management is outlined; topics include grazing and haying. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest, N-R forms, photographs, and
  newspaper articles are included.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
